using namespace std;

int main() {

	int N;
	cin >> N;

	if (N < 8) { cout << N; return 0; }

	vector<int> DP(N+1, 101); // DP[i] == –Ω–∞–∏–º–µ–Ω—å—à–µ–µ —á–∏—Å–ª–æ —Å–ª–∞–≥–∞–µ–º—ã—Ö –≤ –∫—É–±–∏—á–µ—Å–∫–æ–º —Ä–∞–∑–ª–æ–∂–µ–Ω–∏–∏ —á–∏—Å–ª–∞ i : i \in |N --> –∏—Å–∫–æ–º–æ–µ == DP.back()
	DP[0] = 0;

	for (int i = 1; i < N + 1; ++i) {

		int cube = 1;
		int step_cube = 1;

		while (cube <= i) {

			if (cube == i) { DP[i] = 1; break; }
			if (DP[i] > DP[i - cube] + 1) { DP[i] = DP[i - cube] + 1; } // –∏—â–µ–º –Ω–∞–∏–±–æ–ª–µ–µ –æ–ø—Ç–∏–º–∞–ª—å–Ω—ã–µ –ø—Ä–µ–¥—à–µ—Å—Ç—á–≤—É—é—â–∏–µ –∫—É–±–∏—á–µ—Å–∫–∏–µ —Ä–∞–∑–ª–æ–∂–µ–Ω–∏—è –¥–ª—è 

			//cube = step_cube * step_cube * step_cube;
			
        	const int power_indicator = 3; // 3 -- —Å—Ç–µ–ø–µ–Ω–Ω–æ–π –ø–æ–∫–∞–∑–∞—Ç–µ–ª—å, –ø—Ä–∏ –∑–∞–º–µ–Ω–µ –µ–≥–æ –Ω–∞ —á–∏—Å–ª–æ k, –ø–æ–ª—É—á–∞–µ–º —Ä–µ—à–µ–Ω–∏–µ –¥–ª—è k-—ã—Ö —Å—Ç–µ–ø–µ–Ω–µ–π
			array<int, power_indicator> foo; 
			foo.fill(step_cube);
			cube = accumulate(foo.begin(), foo.end(), 1, multiplies<int>());
			++step_cube;
		}

	}

	cout << DP.back();
}

